import React from "react";
import FacebookIcon from "../../../assets/images/facebook-black.png";
import InstagramIcon from "../../../assets/images/instagram-black.png";
import TwitterIcon from "../../../assets/images/twitter-black.png";

const ContactDetails = () => {
  return (
    <div className='contact-details-container'>
      <div class='phone-contact'>
        <div className='phone-contact-title'></div>
        <div className='phone-contact-text'></div>
      </div>
      <div class='fax-contact'>
        <div className='fax-contact-title'></div>
        <div className='fax-contact-text'></div>
      </div>
      <div class='address-contact'>
        <div className='address-contact-title'></div>
        <div className='address-contact-text'></div>
      </div>
      <div class='email-contact'>
        <div className='email-contact-title'></div>
        <div className='email-contact-text'></div>
      </div>
      <div class='socials-contact'>
        <div className='socials-contact-title'></div>
        <div className='socials-contact-links'>
          <img src={FacebookIcon} alt='' />
          <img src={InstagramIcon} alt='' />
          <img src={TwitterIcon} alt='' />
        </div>
      </div>
    </div>
  );
};

export default ContactDetails;
